import React from 'react';
import { Card, Container, Button } from 'semantic-ui-react'
import commands from '../file/Society';
import './Society.css';

function Replace() {
    window.location.replace('https://drive.google.com/file/d/1ZNAnK62OnL0ZdCqyhdE8FTOfH9bBZ0VP/view')
}

function Society() {
    return (
        <div className='Commands'>
            <Container>
                <Card.Group items={commands} className='CommandsCard' itemsPerRow={4} stackable />
                <div className='DownloadButton'>
                    <Button onClick={Replace()}>조례안 열람</Button>
                </div>
            </Container>
        </div >
    );
}

export default Society;
